import React from 'react';
import UserItem from './UserItem';

function UserList(props) {
    const { users } = props;
    
    return (
        <div>
            <h2>Lista utilizatorilor:</h2>
            { users.map((user, index) => {
                
                return (
                <div>
                
                <UserItem
                    id={ user.id }
                    name={ user.name }
                    email={ user.email }
                    salary={user.salary}
                    image={user.image}
                    isGoldClient={ user.isGoldClient }
                    key={ index }
                />
              <button onClick={()=> this.props.deleteUser()}>Sterge utilizator</button>
              </div>)  
            })}
        </div>
    );
}

export default UserList;
